import './App.css';
import { Route, BrowserRouter, Switch, Redirect} from "react-router-dom"; 
import routes from './config/routes';
import { isRegistered } from './utils/cookie';

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        {routes.map((route) => {
          if(isRegistered()) {
            <Redirect to='/registereduser' />
          }
          else {
            return (
              <Route
                path={route.path} 
                exact component={route.component} 
                key={route.path}
              />
            )
          }
        })}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
